import axios from "axios";
import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import { apiUrl } from "../axios";
import {jwtDecode} from "jwt-decode";

export default function Login() {
  const navigate = useNavigate();
  const [formvalues, setformvalues] = useState({});
  const [formError, setFormError] = useState("");

  const onChangeHandler = (e) => {
    setformvalues({ ...formvalues, [e.target.name]: e.target.value });
  };

  const onSubmit = (e) => {
    e.preventDefault();
    axios
      .post(apiUrl + "/medical_store_app/login/", formvalues)
      .then((response) => {
        sessionStorage.setItem("access_token", response.data.access);
        sessionStorage.setItem("refresh_token", response.data.refresh);

        const user = jwtDecode(response.data.access);
        const userId = user.user_id;
        const username = user.name;
        const user_type = user.user_type;

        axios.defaults.headers.common["Authorization"] = `Bearer ${response.data.access}`;

        sessionStorage.setItem("user_id", userId);
        sessionStorage.setItem("name", username);
        sessionStorage.setItem("user_type", user_type);

        if (user_type === "admin") {
          alert("Admin login successfully!");
          navigate("/Admin/DashBoard");
        } else if (user_type === "user") {
          alert("User login successfully!");
          navigate("/user/Home/");
        }
      })
      .catch((error) => {
        if (error.response && error.response.status === 401) {
          setFormError(error.response.data.detail);
        }
      });
  };

  // Styles object
  const styles = {
    container: {
      display: 'flex',
      flexDirection: 'column',
      alignItems: 'center',
      justifyContent: 'center',
      height: '100vh',
      backgroundColor: '#f4f4f4',
    },
    form: {
      background: '#fff',
      padding: '40px',
      borderRadius: '6px',
      boxShadow: '0 2px 5px rgba(0,0,0,0.2)',
      width: '300px',
      textAlign: 'center',
    },
    label: {
      display: 'block',
      marginBottom: '9px',
      fontWeight: 'bold',
    },
    input: {
      width: '100%',
      padding: '10px',
      marginBottom: '15px',
      border: '1px solid #ccc',
      borderRadius: '4px',
    },
    button: {
      width: '100%',
      padding: '10px',
      backgroundColor: '#007BFF',
      color: '#fff',
      border: 'none',
      borderRadius: '4px',
      cursor: 'pointer',
      fontWeight: 'bold',
    },
    switchButton: {
      marginTop: '10px',
      padding: '10px',
      backgroundColor: '#6c757d',
      color: '#fff',
      border: 'none',
      borderRadius: '4px',
      cursor: 'pointer',
      fontWeight: 'bold',
    },
    error: {
      color: 'red',
      marginTop: '10px',
    },
  };

  return (
    <div>
      <div className="container mt-5 p-4" style={styles.container}>
        <form onSubmit={onSubmit} method="post" className="form" style={styles.form}>
          <div className="row mt-3 mb-3">
            <h4 className="text-center" style={styles.heading}>
              <i className="bi bi-person-circle px-3"></i>Login
            </h4>
          </div>
          <div className="row mb-3">
            <div className="col">
              <label htmlFor="username" className="form-label" style={styles.label}>
                UserName
              </label>
              <input
                type="text"
                name="username"
                placeholder="username"
                className="form-control"
                style={styles.input}
                onChange={onChangeHandler}
              />
            </div>
          </div>
          <div className="row mb-3">
            <div className="col">
              <label htmlFor="password" className="form-label" style={styles.label}>
                Password
              </label>
              <input
                type="password"
                name="password"
                placeholder="password"
                className="form-control"
                style={styles.input}
                onChange={onChangeHandler}
              />
            </div>
          </div>
          <p style={styles.error}>{formError}</p>
          <p>
            New User? <a href="register" style={styles.registerLink}>Register here</a>
            <br />
          </p>
          <div className="row mb-3">
            <div className="col">
              <button type="submit" className="btn btn-dark col-3" style={styles.button}>
                Login
              </button>
            </div>
          </div>
        </form>
      </div>
    </div>
  );
}
